const App = () => {
  const course = "Half Stack Application Devlopment";
  const parts = {
    name: " Half Stack Application Development",
    parts: [
      {
        name: "Fundamentals of React",
        exercises: 10,
      },
      {
        name: "Using Props to Pass Data",
        exercises: 7,
      },
      {
        name: "State of a Component",
        exercises: 14,
      },
    ],
  };

  const person = [
    {
      name: "ronald",
      year: 1999,
    },
    {
      name: "Joshua",
      year: 1998,
    },
  ];

  return (
    <div>
      <h1></h1>
      <h1>
        <Header parts={parts} />
        <Content parts={parts} />
        <Total person={person} />
        <Arto />
      </h1>
    </div>
  );
};

class Person {
  constructor(name, age) {
    this.name = name;
    this.age = age;
  }

  greet() {
    console.log("Hello!" + this.name + this.age);
  }
}

const Content = (props) => {
  //render parts
  console.log(props.parts.parts[0].name);
  const person1 = new Person("ronald", 21);
  person1.greet();
  return (
    <div>
      <p>
        {props.parts.parts[0].name} {props.parts.parts[0].exercises}
      </p>
      <p>
        {props.parts.parts[1].name} {props.parts.parts[0].exercises}
      </p>
      <p>
        {props.parts.parts[2].name} {props.parts.parts[0].exercises}
      </p>
      <p></p>
    </div>
  );
};

const Header = (props) => {
  return (
    <div>
      <h1>{props.parts.name}</h1>
    </div>
  );
};

//obj + method

const Arto = () => {
  const obj = {
    name: "Test",
    greet: function () {
      console.log("hello, this is " + this.name);
    },
  };

  setTimeout(obj.greet.bind(obj), 1000);
  // const refToGreet = obj.greet;

  // refToGreet();
  return <></>;
};

const Total = (props) => {
  const countYear = () => {
    const yearNow = new Date().getFullYear();
    console.log(yearNow);
    return yearNow - props.person[0].year;
  };

  return (
    <>
      <h1>
        Hi, {props.person[0].name} your age is {countYear()}
      </h1>
    </>
  );
};

export default App;
